import 'rsuite/dist/styles/rsuite-default.css';
import React, { ReactNode } from 'react';
import Panel from 'rsuite/lib/Panel';
import PanelGroup from 'rsuite/lib/PanelGroup';

function deleteKeys(obj: any, keys: string[]) {
  if (obj && keys && Array.isArray(keys)) {
    keys.forEach((key: string) => {
      delete obj[key];
    });
  }
}

export type PanelGroupVProps = {
  accordion?: boolean;
  activeKey?: any;
  defaultActiveKey?: any;
  onSelect?(eventKey: any, event: any): void;
  classPrefix?: string;
  children?: any;
  style?: any;
};

export type PanelVProps = {
  bodyFill?: boolean;
  bordered?: boolean;
  shaded?: boolean;
  classPrefix?: string;
  collapsible?: boolean;
  defaultExpanded?: boolean;
  eventKey?: any;
  expanded?: boolean;
  header?: ReactNode;
  id?: string | number;
  children?: any;
  style?: any;
};

const delete_keys = [
  'children'
];

export const PanelV = (props: PanelVProps) => {
  let _panelProps = {...props};
  deleteKeys(_panelProps, delete_keys);
  return <Panel {..._panelProps}>{props.children}</Panel>;
};

export const PanelGroupV = (props: PanelGroupVProps) => {
  let _panelGroupProps = {...props};
  deleteKeys(_panelGroupProps, delete_keys);
  return <PanelGroup {..._panelGroupProps}>{props.children}</PanelGroup>;
}
